export default function About() {
  let pageContent = "";
  pageContent = (
    /* Page Content*/
    <div className="container px-4 px-lg-5">
      {/* Heading Row*/}
      <div className="row gx-4 gx-lg-5 align-items-center my-5">
        <div className="col-lg-7">
          <h1 className="font-weight-light">Welcome to the Fancy movies!</h1>
          <p>
            Hope you enjoy your fancy movies, fell free to share your opinion about this site.
          </p>
        </div>
        <div className="col-lg-5">
          <img
            className="img-fluid rounded mb-4 mb-lg-0"
            src="https://media.timeout.com/images/105771947/750/562/image.jpg"
            alt="..."
          />
        </div>
      </div>
    </div>
  );
  return <div>{pageContent}</div>;
}
